import router from '/src/main/resources/router';
import Vue from "vue"; // importera din router från filen där du definierade den
import { createApp } from 'vue'
import App from './App.vue'

createApp(App).mount('#app')
Vue.config.productionTip = false;

new Vue({
    router, // lägg till routern i Vue-instansen
    render: h => h(App)
}).$mount('#app');
